export class Customers {
    name = String;
    size = Number;
    queue = String; 
    table = String;
    GroupSeqNo = String;

    constructor(
        name = String,
        size = Number,
        queue = String,
        table = String,
        GroupSeqNo = String,
    )
    {
        this.name = name;
        this.size = size;
        this.queue = queue;
        this.table = table;
        this.GroupSeqNo = GroupSeqNo;
    }
}
